import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => (
  <header className="navbar">
    <nav>
      <ul>
        <li><Link to="/dashboard">Home</Link></li>
        <li><Link to="#">Profile</Link></li>
        <li><Link to="/signin">Log Out</Link></li>
      </ul>
    </nav>
  </header>
);

export default Navbar;
